  `consignor_id` varchar(45) NOT NULL,
  `consignor_name` varchar(45) NOT NULL,
  `consignor_phone` varchar(45) NOT NULL,
  `origin` varchar(255) NOT NULL,
  `destination` varchar(255) NOT NULL,
  `detailed_origin` varchar(255) DEFAULT NULL,
