  `type` int(4) NOT NULL COMMENT '0：拼车\\n1：整车',
  `is_cargo_taking` tinyint(1) NOT NULL COMMENT '0：代表未接单\\n1：代表已结单',
  `mass` float NOT NULL,
  `volume` float NOT NULL,
  `price` double DEFAULT NULL,
  `cargo_description` varchar(255) DEFAULT NULL,
  `completed` tinyint(1) DEFAULT '0' COMMENT '0未完成; 1已完成',
  `grade` float DEFAULT '0',
  `payed` tinyint(1) DEFAULT '0',
  `big` tinyint(1) DEFAULT '0',
  `transportation_record_id` int(11) NOT NULL DEFAULT '-1',
  `real_price` double DEFAULT '0',
  `current_city` varchar(45) DEFAULT NULL,
  `current_state` int(11) NOT NULL DEFAULT '0',
  `expected_arrival_time` timestamp NULL DEFAULT NULL,
  `expected_price` int(11) DEFAULT '0',
  `transportation_center_id` int(11) DEFAULT '0' COMMENT '与转运中心绑定',
  PRIMARY KEY (`id`),
  UNIQUE KEY `cargo_id_UNIQUE` (`cargo_id`)
) ENGINE=InnoDB AUTO_INCREMENT=448 DEFAULT CHARSET=utf8 COMMENT='货物';

